function newA(as, ps, ms) {
    return Object.keys(as).inject({}, function(result, i) {
        var a = pt(0, 0);
        var c = this.coeff.currentValue;
        Object.keys(as).forEach(function(j) {
            if (i === j) return;
            var d = ps[i].distSquared(ps[j]),
                diff = ps[j].subPt(ps[i]),
                norm = diff.scaleBy(1.0/diff.r());
            a = a.addPt(norm.scaleBy(ms[j] / d));
        }, this)
        result[i] = a;
        return result
    }, this);
}

