function updateMs(ms) {
    var result = {};
    var c = this.coeff.currentValue;
    this.bodiesDo(function(m) {
        result[m.id] = ms[m.id] ||
            (function(m) {
                var e = m.getExtent();
                return (e.x * e.y) * (e.x * e.y) * (e.x * e.y) /
                 c / c;
            })(m);
    });
    this.ms.currentValue = result;
    this.ms.sync();
}

