function updatePs(ps) {
    var result = {};
    this.bodiesDo(function(m) {
        if (ps[m.id]) {
            result[m.id] = ps[m.id]
        } else {
            var c = this.getExtent().scaleBy(0.5);
            result[m.id] = m.getPosition().subPt(c).scaleBy(1.0/this.coeff.currentValue);
        }
    });
    this.ps.currentValue = result;
    this.ps.sync();
}

